import React from "react";

function Frontend() {
  return (
    <div className="skills__content">
      <h3 className="skills__title"></h3>

      <div className="skills__box">
        <div className="skills__group">
          <div className="skill__data"></div>
        </div>
      </div>
    </div>
  );
}

export default Frontend;
